Build a Rust program that calculates the sum of all even integers between two given numbers. The program should use a loop to iterate over the range of integers and calculate the sum of all even integers.

Solution:
```rust
fn main() {
    let mut sum = 0;

    for i in 1..=100 {
        if i % 2 == 0 {
            sum += i;
        }
    }

    println!("The sum of all even integers between 1 and 100 is {}", sum);
}
```
